import React from "react";

const FlightSearchResult = ({ origin, destination, emissions }) => {
  return (
    <div>
      <p>{origin}</p>
      <p>{destination}</p>
      <p>{emissions}</p>
    </div>
  );
};

export default FlightSearchResult;
